import React from 'react';
import logo from './logo.svg';
import './App.css';
import {DownCounter, Square,Triangle,UpCounter} from "./Button";
import {CountNumber, DropCounter, GainCounter} from "./Counter";

function App() {
  return (
    <div className="App">

      <Square />
      <Triangle />
      <UpCounter />
      <DownCounter />
      <GainCounter />
      <DropCounter />
      <CountNumber />
    </div>
  );
}

export default App;
